import "./HeroStyles.css";
import React from "react";
import Image1 from "../assets/kedarnath.jpeg";
import { Link } from "react-router-dom";
import { TypeAnimation } from "react-type-animation";

const Hero = () => {
  return (
    <div className="hero">
      <div className="mask">
        <img className="intro-image" alt="Kedarnath" src={Image1} />
      </div>
      <div className="content">
        <p>Hi, I am a Traveller !</p>
        <h1>React Developer</h1>
        <TypeAnimation
          sequence={[
            `Welcome to my website!\nI'm a Developer\nand a Designer.`,
            1000,
            "",
          ]}
          speed={50}
          style={{ whiteSpace: "pre-line", fontSize: "2em", color: "white" }}
          repeat={Infinity}
        />
        <div>
          <Link to="/Destinations" className="btn">
            Destinations
          </Link>
          <Link to="/Contact" className="btn btn-light">
            Contact
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Hero;
